def five_in_prime(n: int) -> int:

    def is_prime(num: int) -> bool:
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    count = 1
    for i in range(2, n):
        if is_prime(i):
            count += str(i).count('5')
    return count

